import logo from './logo.svg';
import './App.css';
import Styled from 'styled-components';

const Logo = Styled.div `
  width: 100px;
`;

function App() {
  return (
    <div className="App">
      <header>
        <img src="./logo.png" />
        </header>
    </div>
  );
}

export default App;
